import axios from "axios";

const BASE_URI = "http://localhost:8081";

export const testConnection = () => {
    try {
        const res = axios.get(`${BASE_URI}/test-connection`)
        // console.log(res)
        res.then((data)=>{
            console.log(data);
        })
    } catch (error) {
        console.log(error)
    }
}

export const loginService = async (data) => {
    try {
        const res = axios.post(`${BASE_URI}/login`, data)
        res.then((data)=>{
            console.log(data);
        })
    } catch (error) {
        console.log(error)
    }
}
